description.original:
Эмоции зашкаливают)! Недавно вечером увидели китов прямо напротив дома. Событие не очень редкое, но киты пришли не так давно. Так что @taniaelisarieva и @hispaniolaisland схватили фотоаппараты и начали снимать. Обычно киты плывут по своим делам. Показали спины или хвосты, пустили пару фонтанов и привет. В этот раз они были почти на одном и том же месте часа два. Я думал сплавать к ним (уже пробовал не раз). Но так как до этого были сплошные фиаско не решался долго. На исходе второго часа решился попробовать. Взял снаряжение, поплыл в их сторону. Прямо перед моим входом в воду они показали спины. Туда я и поплыл. Ныряя по пути я слышал их песни, но знал, что это ничего не значит. Вода разносит звуки очень далеко. Увидел по пути тунцов, потом рифовую акулу. Решил погнаться за ней, нырнул, повернул голову и обалдел... Два кита замерли у дна на глубине всего 15 метров и не двигались. От обилия эмоций я чуть не выплюнул сердце (зря сегодня в выходной от тренировок день я все же решился выпить вкусного доминиканского кофе). Разговариваю сам с собой, успокаиваю, но все равно эмоции зашкаливают. Думал увидеть их проплывающими мимо, но не ожидал, что они будут просто лежать и подпустят меня к себе. Вода на закате уже не такая прозрачная, да и одному было страшновато их трогать (очень хотелось). Когда они меня заметили, то стали уплывать. Догнать конечно нереально, хотя я попытался. Поплыл обратно домой и сидел еще часа два в шоковом состоянии от переизбытка эмоций. Вроде бы одной мечтой меньше, но хочется еще. Жизнь удивительна, а сегодня для меня очень особенный день... 🇩🇴🌅🐳🐳🇩🇴 What a day... meet two whales near home. Still in shock... #lapreciosa_surf #surfholidaysru @heroeveryone #heroeveryone @quiksilver_ru 
#Equipment #Снаряжение: #bifins #molchanovs 
@molchanovsfreediving #molchanovsfreediving
